CREATE PROCEDURE [dbo].[EPK_sp_ReporteVariacionesCalcular]
(
	@FechaI	AS DATE,
	@FechaF	AS DATE,
	@IdEmpleado	AS BIGINT	= NULL,
	@IdRegion	AS INT		= NULL,
	@IdGerencia	AS CHAR(21)	= NULL,
	@IdCargo	AS CHAR(21)	= NULL
)
AS

BEGIN -- SET NOCOUNT ON added to prevent extra result sets from -- interfering with SELECT statements. SET NOCOUNT ON;
DECLARE @idE INT, @FormaPago VARCHAR(100)
SELECT @idE = dbo.fn_ObtenerParametroEntero ('ID_EFECTIVO', getdate(),1)
SELECT IdFormaPago, FormaPago, Banco, POS, SUM(MontoPagos) MontoPagos, SUM(MontoCierre) MontoCierre, SUM(Diferencia) Diferencia FROM ( SELECT FP.IdFormaPago, FP.Descripcion FormaPago, NULL Banco, NULL POS, CP.MontoPagos, (SELECT SUM(TotalAprobado) FROM EPK_AlivioEfectivoEncabezado WHERE FechaAlivio =E.Fecha ) MontoCierre, CP.MontoPagos - (SELECT SUM(TotalAprobado) FROM EPK_AlivioEfectivoEncabezado WHERE FechaAlivio = E.Fecha ) Diferencia FROM EPK_CierreVentaEncabezado E INNER JOIN EPK_CierreVentaPagos CP ON E.IdCierreV = CP.IdCierreV INNER JOIN EPK_FormaPago FP ON CP.IdFormaPago = FP.IdFormaPago WHERE fp.DatosPOS =0 AND Fecha BETWEEN @FechaDesde AND @FechaHasta AND FP.IdFormaPago =@idE UNION ALL SELECT FP.IdFormaPago, FP.Descripcion FormaPago, NULL Banco, NULL POS, CP.MontoPagos, CP.MontoCierre, CP.MontoPagos - CP.MontoCierre Diferencia FROM EPK_CierreVentaEncabezado E INNER JOIN EPK_CierreVentaPagos CP ON E.IdCierreV = CP.IdCierreV INNER JOIN EPK_FormaPago FP ON CP.IdFormaPago = FP.IdFormaPago WHERE fp.DatosPOS =0 AND Fecha BETWEEN @FechaDesde AND @FechaHasta AND FP.IdFormaPago <>@idE UNION ALL SELECT FP.IdFormaPago, FP.Descripcion FormaPago, ENT.Nombre Banco, POS.Descripcion POS, CP.TotalDia, CP.MontoCierre, CP.TotalDia - CP.MontoCierre Diferencia FROM EPK_CierreVentaEncabezado E INNER JOIN EPK_CierreVentaPOS CP ON E.IdCierreV = CP.IdCierreV INNER JOIN EPK_FormaPago FP ON CP.IdFormaPago = FP.IdFormaPago INNER JOIN EPK_POS POS ON POS.IdPOS = CP.IdPOS INNER JOIN EPK_EntidadFinanciera ENT ON ENT.IdEntidad = POS.IdEntidad WHERE Fecha BETWEEN @FechaDesde AND @FechaHasta ) t GROUP BY IdFormaPago, FormaPago, Banco, POS ORDER BY t.IdFormaPago ---- SET NOCOUNT ON added to prevent extra result sets from ---- interfering with SELECT statements. --SET NOCOUNT ON;
----DECLARE @FechaDesde DATE = '20130801',@FechaHasta DATE = '20130829' --select * --from -- (SELECT FP.IdFormaPago, FP.Descripcion FormaPago, NULL Banco, NULL POS, CP.MontoPagos, CP.MontoCierre, CP.MontoPagos - CP.MontoCierre Diferencia -- FROM EPK_CierreVentaEncabezado E -- INNER JOIN EPK_CierreVentaPagos CP -- ON E.IdCierreV = CP.IdCierreV -- INNER JOIN EPK_FormaPago FP -- ON CP.IdFormaPago = FP.IdFormaPago -- UNION ALL -- SELECT FP.IdFormaPago, FP.Descripcion FormaPago, ENT.Nombre Banco, POS.Descripcion POS, CP.TotalDia, CP.MontoCierre, CP.TotalDia - CP.MontoCierre Diferencia -- FROM EPK_CierreVentaEncabezado E -- INNER JOIN EPK_CierreVentaPOS CP -- ON E.IdCierreV = CP.IdCierreV -- INNER JOIN EPK_FormaPago FP -- ON CP.IdFormaPago = FP.IdFormaPago -- INNER JOIN EPK_POS POS -- ON POS.IdPOS = CP.IdPOS -- INNER JOIN EPK_EntidadFinanciera ENT -- ON ENT.IdEntidad = POS.IdEntidad ) t --order by t.IdFormaPago END

BEGIN -- SET NOCOUNT ON added to prevent extra result sets from -- interfering with SELECT statements. SET NOCOUNT ON;
DECLARE @Status TINYINT SET @Status = DBO.fn_ObtenerParametroEntero ('FACProcesada', GETDATE(), 1)
SELECT FotoMediana FotoPeq, Fecha, FE.IdFactura, RTRIM(LTRIM(CodigoReferencia)) CodReferencia, RTRIM(LTRIM(CodigoArticulo)) CodArticulo, RTRIM(LTRIM(A.Descripcion)) Descrip, A.Activo Act, SUM( CASE WHEN CAMBIO =1 THEN Cantidad*-1 ELSE Cantidad END ) Ventas FROM EPK_FacturaDetalle FD INNER JOIN EPK_FacturaEncabezado FE ON FD.IdFactura = FE.IdFactura INNER JOIN EPK_Articulo A ON A.IdArticulo = FD.IdArticulo INNER JOIN EPK_Referencia R ON A.IdReferencia = R.IdReferencia WHERE FE.Fecha BETWEEN @FechaDesde AND @FechaHasta AND FE.IdEstatus = @Status AND (@IdColeccion = 0 OR R.IdColeccion = @IdColeccion) GROUP BY FotoMediana, Fecha, FE.IdFactura, CodigoReferencia, CodigoArticulo, A.Descripcion, A.Activo, Cambio ORDER BY Fecha, FE.IdFactura, CodigoArticulo -- HAVING SUM(CASE WHEN CAMBIO =1 THEN Cantidad*-1 ELSE Cantidad END) <> 0 END

